import React from "react";
import "./nav.css";
const Nav = () => {
  return (
    <>
      <div className="nav-main">
        <div className="img"></div>
        <div className="list">
          <ul>
            <li>Home⇂</li>
            <li>About⇂</li>
            <li>Services⇂</li>
            <li>Blog⇂</li>
            <li>Contact</li>
          </ul>
        </div>
        <button className="primary-btn">Request A Quote</button>
      </div>
    </>
  );
};

export default Nav;
